import Axios from 'axios';
import {
    ORDER_SAVE_VEHICLE_DETAILS,
  } from "../constants/orderFormConstants";

export const saveVehicleDetails = (data) => (dispatch) => {
    dispatch({ type: ORDER_SAVE_VEHICLE_DETAILS, payload: data});
    localStorage.setItem('vehicleDetails', JSON.stringify(data));
}
